import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const Note = (props) => {
    return (
        <>
            <div className = "container" style = {{border: "2px solid"}}>
                <div className = "directionFlex">
                    <div className = "col-md-3 col-12 noteHeading">
                        <h4>{props.itemTitle}</h4>
                        <p>{props.itemContent}</p>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Note;
